import React from 'react';
import VNA from '../components/VNA';
import ClaseDigital from '../components/ClaseDigital';
import vaca from '../components/vaca';
import '../assets/style/app.scss';



const App= () =>{
    return (

        <div className="App">
            <VNA/>
            <vaca/>
                <ClaseDigital/>
        </div>
    );

}

export default App;
